We use a Markdown extension for snippets . This way code can be referenced instead of copy pasted into the documentation. This avoids code examples from becoming out of date or failing to compile. The syntax is as follows: // --8<-- [start:fun]
fun double(x: Int): Int { return 2 * x
}
// --8<-- [end:fun] Next, you'll be able to reference that piece of code in Markdown like so: --8<-- "example.kt:fun" Where example.kt is the path to the file.

