Expressions are domain specific language (DSL) built by Mapbox for vector styles. Mapbox Vector Style is used in Mapbox Vector Tiles. Mapbox Vector Tiles is a vector tile specification initiated by Mapbox which was later widely adopted by the geospatial community. To recap, Mapbox Vector Styles have 2 significant parts - Sources and Layers . Sources define where the geospatial features to display the map are loaded from. They can be GeoJSON, Mapbox Vector Tiles (MVT) etc. We draw said features on map using Layers . A Layer references a single source. This is where expressions kick in. Expressions define how the data from a source will be painted in a layer following a style. For example, a heatmap, requires the ability to paint features in different zoom levels with different colors. Expressions facilitate that. The rendering depends on the style of the layer along with pitch, bearing, and zoom of the map. This was called Data Driven Styling (DDS) . Another option that was used was to completely change the style in run time to achieve the same outcome [1] . The desire of being able to render a layer in different zoom levels differently based on data drove the birth of expressions . To summarize, expressions do the following: Expressions filter features from a source layer. This allows to apply conditional styling on the full or parts of the feature. Expressions apply rendering transformations to filtered features. MapLibre offers expressions that can interpolate, and paint. An expression can be applied to a feature constantly, zoom dependent, property dependent, or in zoom and property dependent manner. For a simple example of an expression, we will build a layer that displays a text field fixed text hello world for all features in a vector source: { "id": "test", "type": "symbol", "source": "source", "layout": { "text-field": "Hello world" }
} If we wanted it instead to display the name property of each feature, we can use an expression like this: { "text-field": ["get", "name"] } We can also mutate the value fetched from properties of the features. For examplel, we can append a prefix Hello to the name by using the concat expression: { "text-field": ["concat", "Hello, ", ["get", "name"]] } By now, you probably have figured it out that expressions use a JSON-like syntax to define. For brevity, let's look at the construction of an example expression below: '^': [
NumberType,
NumberType, NumberType],
(ctx, [b, e]) => Math.pow(b.evaluate(ctx), e.evaluate(ctx))
] This defines an expression named ^ that returns a number expression, and takes two number expressions as input. The implementation follows right after. Another part to notice here is the implementation evaluates both inputs because they are expressions too. Expressions can be nested. Although it looks like JavaScript, for MapLibre Native , the parser for any expression is written in MapLibre Native Core . Each platform such as iOS, Android has their own Expression class which provides builders to build an expression and add it to a layer. When an expression is added to a layer, the rendering part of the code picks it up in the MapLibre Native Core. Also, inside MapLibre Native Core, this definition mechanism allows extending expressions library with custom expressions if desired.
